create table applications
(
    id               bigserial
        primary key,
    city_id          integer      not null
        references cities,
    clinic_id        integer
        references clinics,
    full_name        varchar(255) not null,
    birth_date       varchar(15),
    phone            varchar(25)  not null,
    promo_code       varchar(100),
    created_at       timestamp,
    updated_at       timestamp,
    full_name_parent varchar(255),
    tg_user_id       bigint,
    tg_chat_id       bigint,
    send_to_1c       boolean,
    doctor_id        integer
        constraint fk_applications_doctors
            references doctors
);

alter table applications
    owner to clinic_management_user;

create index applications_city_id_idx
    on applications (city_id);

create index applications_clinic_id_idx
    on applications (clinic_id);

create index applications_doctor_id_idx
    on applications (doctor_id);

